import React from "react";
import { ReactDOM } from "react";

const headerBody = () => {


    return (
        <div class='headerBody'>
                <img  class ='HBImage' src='https://thumbs.dreamstime.com/b/italian-pizza-fresh-salad-red-wine-wide-composition-party-dinner-flat-lay-various-kinds-glasses-over-rustic-wooden-table-174281796.jpg' />
            <div class='imgFooter'>
                <div class = 'IFTime'>
                    <p>Pizzas!</p>
                </div>
                <div class='status'>
                    <button id="myButton" onClick={change}><p>{elem.value}</p></button>
                </div>
            </div>
        </div>
    )
    function change() {
        let elem = document.getElementById('myButton');
        if (elem.value=="Aberto") elem.value == "Fechado";
        else elem.value = 'Aberto'
    }
}

export default headerBody;
